import React from 'react'
import img1 from "../images/103710.jpg"

function MyCarousel() {

   const lesImages = [
      {src: '../images/103710.jpg', alt: 'slide1'},
      {src: '../images/2225_854x480 - Copie.jpg', alt: 'slide2'},
      {src: '../images/402866.jpg', alt: 'slide3'},
      {src: '../images/497284.jpg', alt: 'slide4'}
  ]


  return (
    <div>
   {lesImages.map((image, key) => (
      <div>
          <img key={key} src={image.src} alt={image.alt} width="100%" height="100%"/>    
      </div>
       ))}
    </div>
  )
}

export default MyCarousel
